window.bookSummaryJSON = "<p><b>The Merry Band of Pirates stopped the enemy from stealing a Sentinel, and destroyed its Elder starship, so why weren’t the Pirates planning a victory party?</b></p> <p>The enemy was not what they thought it was.</p> <p>It was much, much worse.</p> <p>They had not a single clue how to defeat that enemy, or how to fight it, or whether fighting it was even possible. Only one thing was certain: the Pirates couldn’t handle this fight alone.</p>"; 
